import React, { useState } from 'react';
import UploadVideo from './components/UploadVideo';
import LiveFeed from './components/LiveFeed';  // Assuming you have a component for live feed

const App = () => {
  const [tab, setTab] = useState('upload');  // Default tab is 'upload'

  return (
    <div className="container mx-auto p-8">
      <div className="flex justify-center space-x-4 mb-8">
        <button
          onClick={() => setTab('live')}
          className={`px-6 py-3 ${tab === 'live' ? 'bg-blue-700' : 'bg-blue-500'} text-white rounded-lg`}
        >
          Live Video Feed
        </button>
        <button
          onClick={() => setTab('upload')}
          className={`px-6 py-3 ${tab === 'upload' ? 'bg-blue-700' : 'bg-blue-500'} text-white rounded-lg`}
        >
          Upload Video
        </button>
      </div>

      {tab === 'upload' ? <UploadVideo /> : <LiveFeed />}
    </div>
  );
};

export default App;
